    }


    public void flatten(TreeNode root) {
        while (root!= null) {
            if (root.left!= null) { 
                TreeNode n = root.left;
                while (n.right!= null) n = n.right; 
                n.right = root.right; 
                root.right = root.left; 
                root.left = null; 
            }
            root = root.right; 
        }
    }

    public class TreeNode {
        int val;
        TreeNode left;
