public class LeetCode367 {


    public boolean isPerfectSquareBinarySearch(int num) {
        long low = 0, high = num, mid;
        while (low <= high) {
            mid = low + (high - low) / 2;
            long mid2 = mid * mid;
            if (mid2 == num) {
                return true;
            }
            if (mid2 < num) {
                high = mid - 1;
            } else {
                low = mid + 1;
            }
        }
        return false;
    }


    public boolean isPerfectSquareNewton(int num) {
        long x = num;
        while (x * x > num) {
            x = (x + num / x) / 2;
        }
        return x * x == num;
    }
}


