import java.util.Deque;

class Solution {
    public String longestWord(String[] words) {
        Arrays.sort(words);
        int cursor = 0;

        String result = "";
        Deque<String> stack = new Deque<>();
        stack.addFirst(result);
        while (cursor < words.length) {
            if (stack.getLast().length() >= words[cursor].length()) {
                stack.removeLast();
            } else {
                if (stack.getLast().length() + 1 == words[cursor].length() && words[cursor].indexOf(stack.getLast()) == 0) {
                    if (words[cursor].length() > result.length()) result = words[cursor];
                    stack.addFirst(words[cursor]);
                }
                cursor++;
            }
        }
        return result;
    }
}

